    public static String hexToString(String hex) {
        StringBuilder finalString = new StringBuilder();
        StringBuilder tempString = new StringBuilder();
        int i = 0;
        while (i < hex.length() - 1) {
            String output = hex.substring(i, i + 2);
            int decimal = Integer.parseInt(output, 16);
            finalString.append((char) decimal);
            tempString.append(decimal);
            i += 2;
        }
        return finalString.toString();
    }

    /**
     * 十六进制转byte
     *
     * @param src String Byte字符串，每个Byte之间没有分隔符(字符范围:0-9 A-F)
     * @Description: 十六进制转byte
     * bytes字符串转换为Byte值
     * @author november
     * @CreateTime: 2021/9/15 2:45 下午
     */
    public static byte[] hexToBytes(String src) {
        if (src.length() % 2 == 1) {
            src = "0" + src;
        }
        /*对输入值进行规范化整理*/
        src = src.trim().replace(" ", "").toUpperCase(Locale.US);
        //处理值初始化
        int m = 0, n = 0;
        int iLen = src.length() / 2; //计算长度
        byte[] ret = new byte[iLen]; //分配存储空间

        for (int i = 0; i < iLen; i++) {
            m = i * 2 + 1;
            n = m + 1;
            ret[i] = (byte) (Integer.decode("0x" + src.substring(i * 2, m) + src.substring(m, n)) & 0xFF);
        }
        return ret;
    }

    /**
     * byte转十六进制
     *
     * @author november
     * @CreateTime: 2021/9/15 2:56 下午
     */
    public static String bytesToHex(byte[] bytes) {
        StringBuilder stringBuilder = new StringBuilder();
        for (byte aByte : bytes) {
            stringBuilder.append(byteToHex(aByte));
        }
        return stringBuilder.toString().toUpperCase(Locale.ROOT);
    }

    private static String byteToHex(byte b) {
        StringBuilder stringBuilder = new StringBuilder();
        int v = b & 0xFF;
        String hv = Integer.toHexString(v);
        if (hv.length() < 2) {
            stringBuilder.append(0);
        }
        stringBuilder.append(hv);
        return stringBuilder.toString();
    }

    /**
     * 将两个byte数组合并为一个
     *
     * @param data1 要合并的数组1
     * @param data2 要合并的数组2
     * @return 合并后的新数组
     */
    public static byte[] mergeBytes(byte[] data1, byte[] data2) {
        byte[] data3 = new byte[data1.length + data2.length];
        System.arraycopy(data1, 0, data3, 0, data1.length);
        System.arraycopy(data2, 0, data3, data1.length, data2.length);
        return data3;
    }

    /**
     * 将多个个byte数组合并为一个
     *
     * @param bytes 要合并的数组
     * @return 合并后的新数组
     */
    public static byte[] mergeBytes(byte[]... bytes) {
        int size = bytes.length;
        byte[] b = new byte[size];
        for (int i = 0; i < size; i++) {
            if (i == 0) {
                b = bytes[i];
            } else {
                b = mergeBytes(b, bytes[i]);
            }
        }
        return b;
    }

    /**
     * 二进制 转 二进制字符串
     *
     * @author november
     * @CreateTime: 2023/3/27 2:20 下午
     */
    public static String convert2HexStr(byte[] b) {
        StringBuilder result = new StringBuilder();
        for (byte value : b) {
            result.append(Long.toString(value & 0xff, 2)).append(",");
        }
        return result.substring(0, result.length() - 1);
    }

    /**
     * 二进制字符串转换为byte数组,每个字节以","隔开
     **/
    public static byte[] convert2HexToByte(String hex2Str) {
        String[] temp = hex2Str.split(",");
        byte[] b = new byte[temp.length];
        for (int i = 0; i < b.length; i++) {
            b[i] = Long.valueOf(temp[i], 2).byteValue();
        }
        return b;
    }

