    /**
     * 求目标位置
     *
     * @param source 源数组
     * @param target 目标
     * @param from   从哪里开始
     * @return 目标所在位置
     */
    public static int indexOf(byte[] source, byte[] target, int from) {
        int sourceCount = source.length;
        int tarCount = target.length;
        if (from >= sourceCount) {
            return (tarCount == 0 ? sourceCount : -1);
        }
        if (from < 0) {
            from = 0;
        }
        if (tarCount == 0) {
            return from;
        }

        byte first = target[0];
        int max = sourceCount - tarCount;

        for (int i = from; i <= max; i++) {
            /* look for first byte*/
            if (source[i] != first) {
                while (++i <= max && source[i] != first) ;
            }

            if (i <= max) {
                int j = i + 1;
                int end = j + tarCount - 1;
                for (int k = 1; j < end && source[j] == target[k]; j++, k++) ;
                if (j == end) {
                    return i;
                }
            }
        }
        return -1;
    }

