    /**
     * 切割字节数组
     */
    public static byte[] subBytes(byte[] source, int beginIndex) {
        return subBytes(source, beginIndex, source.length);
    }

    /**
     * 切割字节数组
     */
    public static byte[] subBytes(byte[] source, int beginIndex, int endIndex) {
        if (beginIndex < 0) {
            throw new IndexOutOfBoundsException(beginIndex + "");
        }
        if (endIndex > source.length) {
            throw new IndexOutOfBoundsException(endIndex + "");
        }
        int subLen = endIndex - beginIndex;
        if (subLen < 0) {
            throw new IndexOutOfBoundsException(subLen + "");
        }
        if ((beginIndex == 0) && (endIndex == source.length)) {
            return source;
        } else {
            byte[] out = new byte[subLen];
            System.arraycopy(source, beginIndex, out, 0, out.length);
            return out;
        }
    }

    public static boolean startsWith(byte[] source, byte[] prefix) {
        return startsWith(source, prefix, 0);
    }

    public static boolean endsWith(byte[] source, byte[] prefix) {
        return startsWith(source, prefix, source.length - prefix.length);
    }

    private static boolean startsWith(byte[] source, byte[] prefix, int offset) {
        int to = offset;
        int po = 0;
        int pc = prefix.length;
        // Note: offset might be near -1>>>1.
        if ((offset < 0) || (offset > source.length - pc)) {
            return false;
        }
        while (--pc >= 0) {
            if (source[to++] != prefix[po++]) {
                return false;
            }
        }
        return true;
    }

    public static boolean equal(byte[] bytes1, byte[] bytes2) {
        if (bytes1.length != bytes2.length) {
            return false;
        }
        for (int i = 0; i < bytes1.length; i++) {
            if (bytes1[i] != bytes2[i]) {
                return false;
            }
        }
        return true;
    }

